import React from 'react';

//import database
import { tiktok_info } from "../data/tiktok";


const Tiktok = () => {
  return (
    <div className='tiktok-wrapper'>
        <h1>TikTok</h1>

        <section>

            <h2>TikTok Organizer</h2>

            {chakras_info.map((chakra, index) => {
            return <ChakrasInteractive items={chakra} classI={`ch ch${(index+1)}`} key={index} />;
          })}
            <h3>Post Title: </h3>

        </section>

        <section>
            <h2>TikTok Visualizer</h2>
        </section>

    </div>
  )
}

export default Tiktok;
